import React from "react";

export default function Profile() {
  return (
    <div>
      <h4>Profile</h4>
      <div style={{ maxWidth: 420, border: "1px solid #eee", padding: 12, borderRadius: 6, background: "#fff" }}>
        <p><strong>Owner:</strong> Harshini Basana</p>
        <p><strong>Email:</strong> harshini@example.edu</p>
        <p><strong>Role:</strong> Student</p>
      </div>
    </div>
  );
}
